masks.initializationCode:
blk = gcbh;   % Cache handle to block

% for changing default value of isOutputVarDim
if ~strcmp(get_param(blk,'tag'),'vipblks_row_conv')
    set_param(blk,'tag','vipblks_row_conv');
    set_param(blk,'isOutVarDim','off');%'Separate color signals');
end

dtInfo = dspGetFixptDataTypeInfo(blk,127);

stats = false(1,10);

stats(1)  = strcmp(get_param(blk,'area'),'on');
stats(2)  = strcmp(get_param(blk,'centroid'),'on');
stats(3)  = strcmp(get_param(blk,'bBox'),'on');

% Disable some stats if in fixpt mode; some of them simply don't
% get calculated
if ~strncmp(get_param(blk,'outDT'),'specify',7)
	stats(4)  = strcmp(get_param(blk,'majorAxis'),'on');
	stats(5)  = strcmp(get_param(blk,'minorAxis'),'on');
	stats(6)  = strcmp(get_param(blk,'angle'),'on');
	stats(7)  = strcmp(get_param(blk,'eccentricity'),'on');
else
	stats(4)  = false;
	stats(5)  = false;
	stats(6)  = false;
	stats(7)  = false;
end

stats(8)  = strcmp(get_param(blk,'equivDiameterSq'),'on');
stats(9)  = strcmp(get_param(blk,'extent'),'on');
stats(10) = strcmp(get_param(blk,'perimeter'),'on');

% Build up mask labeling command as a string and 
% assign it to the block's icon drawing code
out_idx = 1;

maskdisp = sprintf(['%% do not hand edit; the script below is autogenerated\n']);
maskdisp = [maskdisp sprintf(['%% through Initialization commands \n\n'])];

maskdisp = [maskdisp sprintf(['disp(''Blob\\nAnalysis'');\n'])];
maskdisp = [maskdisp sprintf(['port_label(''input'', 1, ''BW'');\n'])];

% preamble string for labeling output ports
const_str = 'port_label(''output'',';

if stats(1)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Area'');\n'])];
	out_idx = out_idx + 1;
end
if stats(2)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Centroid'');\n'])];
	out_idx = out_idx + 1;
end
if stats(3)
	idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''BBox'');\n'])];
	out_idx = out_idx + 1;
end
if stats(4)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''MajorAxis'');\n'])];
	out_idx = out_idx + 1;
end
if stats(5)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''MinorAxis'');\n'])];
	out_idx = out_idx + 1;  
end
if stats(6)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Orientation'');\n'])];
	out_idx = out_idx + 1;
end
if stats(7)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Eccentricity'');\n'])];
	out_idx = out_idx + 1;
end
if stats(8)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Diameter^2'');\n'])];
	out_idx = out_idx + 1;
end   
if stats(9)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Extent'');\n'])];
	out_idx = out_idx + 1;
end
if stats(10)
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Perimeter'');\n'])];
	out_idx = out_idx + 1;
end 
if strcmp(get_param(blk,'isLabel'),'on');
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Label'');\n'])];
	out_idx = out_idx + 1;
    
end
if strcmp(get_param(blk,'isCount'),'on');
    idx_str  = num2str(out_idx);
    maskdisp = [maskdisp sprintf([const_str idx_str ', ''Count'');\n'])];
	out_idx = out_idx + 1;
    
end

% Warning:  set_param causes the mask init code to run again; prevent it
%           from running when an error occurs in s-function
%           in the case of none of the stats being selected
if any(stats)
    set_param(blk, 'MaskDisplay', maskdisp);
end

